  else
    echo -e "${RED}KO${RESET}"
    echo -e "${RED}KO${RESET}\n${arg}\n" >> fails.txt
  fi
  count=$(echo "$operations" | wc -l)
  if [ "$count" -ge 5500 ]; then
    echo -e "${RED}${count}${RESET}"
    echo -e "${count}\n${arg}\n${operations}\n\n\n" >> fails.txt
  else
    echo -e "${GREEN}${count}${RESET}"
  fi
done